import React from 'react';
import { Provider } from 'react-redux';
import store from './store';
import Board from './components/Board';
import Score from './components/Score';
import './styles/styles.css';

const App = () => (
  <Provider store={store}>
    <div className="game">
      <Score />
      <Board />
    </div>
  </Provider>
);

export default App;
